// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Ownable.sol";


// SushiToken with Governance.
contract SushiToken is ERC20("OpenSwap Token", "oSWAP"), Ownable {
    /// @notice Creates `_amount` token to `_to`. Must only be called by the owner (MasterChef).
    function mint(address _to, uint256 _amount) public onlyOwner {
        _mint(_to, _amount);
    }
    constructor (address _devlock) public {
            _mint(_devlock, 14400000000000000000000000); //Mint dev tokens immidiatly and lock them in contract //14,400,000 OpenSwap
    }
}
